            "atmosphere": "Type I",
            "moons": "3",
            "stars": "Hoth",
            "description": "Even with a surface blanketed in ice plains and glaciers, and temperatures dipping below -60C after nightfall, Hoth supported a minimal web of life, including Wampas, Tauntauns, snowmice, ice scrabblers, and Dragon slugs. Apparently once part of the Rakata's Infinite Empire, Hoth was well-known by 4000 BBY, and the Republic suffered a major defeat against a Sith fleet in orbit, showering the frozen world in shipwrecks. During the Imperial era, Hoth was occasionally visited by smugglers and pirates, and the Rebel Alliance established Echo Base here in 2 ABY. In 3 ABY the Empire discovered the base, resulting in the Battle of Hoth and the Rebels' desperate scramble to evacuate.",
